import ischoolLoginImage from '../../Assets/ischool_login.png';

function Portfolio() {
    return (
        <div className="col-md-3 position-relative">
            <img
                src={ischoolLoginImage} className="img-fluid" style={{ cursor: 'pointer' }} data-bs-toggle="modal" data-bs-target="#imageModal"
            />
            <div className="modal fade" id="imageModal" tabIndex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div className="modal-dialog">
                    <div className="modal-content">
                        <div className="modal-body">
                            <img src={ischoolLoginImage} className="img-fluid"/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Portfolio;
